import React from 'react';
import {Box, ThemeProvider, Typography} from "@mui/material";
import theme from "./theme";

function App() {
    return (
        <ThemeProvider theme={theme}>
            <Box>
                <Box
                    sx={{
                        position: "fixed",
                        top: 0
                    }}>


                    <Box
                        sx={{
                            flexGrow: 1,
                            marginTop: 2,
                            marginLeft: 5,
                            marginRight: 5,

                        }}>
                        <Box
                            sx={{
                                display: "flex",
                            }}>
                            <Typography variant="h5" component="div"
                                        sx={{
                                            flexGrow: 20,
                                            display: "flex",
                                            alignItems: "center"
                                        }}>
                                JZ
                            </Typography>
                            <Typography variant="h6" component="div" sx={{
                                flexGrow: 1,
                                display: "flex",
                                alignItems: "center"
                            }}>
                                work
                            </Typography>
                            <Typography variant="h6" component="div" sx={{
                                flexGrow: 1,
                                display: "flex",
                                alignItems: "center"
                            }}>
                                resume
                            </Typography>
                        </Box>
                    </Box>
                </Box>
            </Box>

        </ThemeProvider>
    );
}

export default App;
